validate_doc_update:
/*
  SERVER DOCUMENT VALIDATION

  This is for validating authority. It is against the medic ddoc because it can
  only usefully be run against couchdb.

  For validations around document structure (and for a validate_doc_update script
  that runs on PouchDB) check ddocs/medic-client/validate_doc_update.js.
*/
function(newDoc, oldDoc, userCtx, secObj) {

  var ADMIN_ONLY_TYPES = [ 'form', 'translations', 'token_login' ];
  var ADMIN_ONLY_IDS = [
    'resources',
    'service-worker-meta',
    'zscore-charts',
    'settings',
    'branding',
    'partners',
    'privacy-policies',
    'extension-libs',
  ];

  var _err = function(msg) {
    throw({ forbidden: msg });
  };

  var hasRole = function(userCtx, role) {
    if (userCtx.roles) {
      for (var i = 0; i < userCtx.roles.length; i++) {
        if (userCtx.roles[i] === role) {
          return true;
        }
      }
    }
    return false;
  };

  var isDbAdmin = function(userCtx, secObj) {
    if (hasRole(userCtx, '_admin')) {
      return true;
    }

    if (secObj.admins && secObj.admins.names &&
        secObj.admins.names.indexOf(userCtx.name) !== -1) {
      return true;
    }

    if (secObj.admins && secObj.admins.roles) {
      for (var i = 0; i < userCtx.roles; i++) {
        if (hasRole(secObj.admins, userCtx.roles[i])) {
          return true;
        }
      }
    }

    return false;
  };

  var isAdminOnlyDoc = function(doc) {
    return (doc._id && doc._id.indexOf('_design/') === 0) ||
           (doc._id && ADMIN_ONLY_IDS.indexOf(doc._id) !== -1) ||
           (doc.type && ADMIN_ONLY_TYPES.indexOf(doc.type) !== -1);
  };

  var checkAuthority = function(newDoc, oldDoc, userCtx, secObj) {

    // ensure logged in
    if (!userCtx.name) {
      _err('You must be logged in to edit documents');
    }

    // admins can do anything
    if (isDbAdmin(userCtx, secObj)) {
      return;
    }

    if (isAdminOnlyDoc(newDoc)) {
      _err('You are not authorized to edit admin only docs');
    }

    if (userCtx.facility_id === newDoc._id) {
      _err('You are not authorized to edit your own place');
    }
  };

  if (newDoc.purged) {
    // Remove this once we move purging to the server side, for now it is to
    // prevent *client-side* purging from leaking into the server side
    return _err('Purged documents should not be written to CouchDB!');
  }

  checkAuthority(newDoc, oldDoc, userCtx, secObj);
  log('medic validate_doc_update passed for User "' + userCtx.name + '" changing document "' +  newDoc._id + '"');
}

doc_summaries_by_id.map:
// WARNING: This is a copy of the GetSummaries service
// with some minor modifications and needs to be kept in sync until
// this workaround is no longer needed.
// https://github.com/medic/medic/issues/4666

function(doc) {
  var getLineage = function(contact) {
    var parts = [];
    while (contact) {
      if (contact._id) {
        parts.push(contact._id);
      }
      contact = contact.parent;
    }
    return parts;
  };

  var isMissingSubjectError = function(error) {
    if (error.code !== 'sys.missing_fields' || !error.fields) {
      return false;
    }

    if (error.fields.indexOf('patient_id') !== -1 ||
      error.fields.indexOf('patient_uuid') !== -1 ||
      error.fields.indexOf('patient_name') !== -1 ||
      error.fields.indexOf('place_id') !== -1) {
      return true;
    }

    return false;
  };

  var getSubject = function(doc) {
    var subject = {};
    var reference = doc.patient_id ||
                    (doc.fields && doc.fields.patient_id) ||
                    (doc.fields && doc.fields.patient_uuid) ||
                    doc.place_id ||
                    (doc.fields && doc.fields.place_id);

    var patientName = doc.fields && doc.fields.patient_name;
    if (patientName) {
      subject.name = patientName;
    }

    if (reference) {
      subject.value = reference;
      subject.type = 'reference';
    } else if (patientName) {
      subject.value = patientName;
      subject.type = 'name';
    } else if (doc.errors) {
      doc.errors.forEach(function(error) {
        if (isMissingSubjectError(error)) {
          subject.type = 'unknown';
        }
      });
    }

    return subject;
  };

  if (doc.type === 'data_record' && doc.form) { // report
    emit(doc._id, {
      _rev: doc._rev,
      from: doc.from || doc.sent_by,
      phone: doc.contact && doc.contact.phone,
      form: doc.form,
      read: doc.read,
      valid: !doc.errors || !doc.errors.length,
      verified: doc.verified,
      reported_date: doc.reported_date,
      contact: doc.contact && doc.contact._id,
      lineage: getLineage(doc.contact && doc.contact.parent),
      subject: getSubject(doc),
      case_id: doc.case_id || (doc.fields && doc.fields.case_id)
    });
  } else if (doc.type === 'contact' ||
      doc.type === 'clinic' ||
      doc.type === 'district_hospital' ||
      doc.type === 'health_center' ||
      doc.type === 'person') { // contact
    emit(doc._id, {
      _rev: doc._rev,
      name: doc.name || doc.phone,
      phone: doc.phone,
      type: doc.type,
      contact_type: doc.contact_type,
      contact: doc.contact && doc.contact._id,
      lineage: getLineage(doc.parent),
      date_of_death: doc.date_of_death,
      muted: doc.muted
    });
  }
}

contacts_by_depth.map:
function(doc) {
  if (['contact', 'person', 'clinic', 'health_center', 'district_hospital'].indexOf(doc.type) !== -1) {
    var value = doc.patient_id || doc.place_id;
    var parent = doc;
    var depth = 0;
    while (parent) {
      if (parent._id) {
        emit([parent._id], value);
        emit([parent._id, depth], value);
      }
      depth++;
      parent = parent.parent;
    }
  }
}

docs_by_replication_key.map:
function (doc) {
  if (doc._id === 'resources' ||
      doc._id === 'branding' ||
      doc._id === 'partners' ||
      doc._id === 'service-worker-meta' ||
      doc._id === 'zscore-charts' ||
      doc._id === 'settings' ||
      doc._id === 'privacy-policies' ||
      doc.type === 'form' ||
      doc.type === 'translations') {
    return emit('_all', {});
  }
  var getSubject = function() {
    if (doc.form) {
      // report
      if (doc.contact && doc.errors && doc.errors.length) {
        for (var i = 0; i < doc.errors.length; i++) {
          // invalid or no patient found, fall back to using contact. #3437
          if (doc.errors[i].code === 'registration_not_found' ||
              doc.errors[i].code === 'invalid_patient_id') {
            return doc.contact._id;
          }
        }
      }
      return (doc.patient_id || (doc.fields && doc.fields.patient_id)) ||
             (doc.place_id || (doc.fields && doc.fields.place_id)) ||
             (doc.fields && doc.fields.patient_uuid) ||
             (doc.contact && doc.contact._id);
    }
    if (doc.sms_message) {
      // incoming message
      return doc.contact && doc.contact._id;
    }
    if (doc.kujua_message) {
      // outgoing message
      return doc.tasks &&
             doc.tasks[0] &&
             doc.tasks[0].messages &&
             doc.tasks[0].messages[0] &&
             doc.tasks[0].messages[0].contact &&
             doc.tasks[0].messages[0].contact._id;
    }
  };
  var value = { type: doc.type };
  switch (doc.type) {
    case 'data_record':
      value.subject = getSubject() || '_unassigned';
      if (doc.form && doc.contact) {
        value.submitter = doc.contact._id;
      }
      if (doc.fields && doc.fields.private) {
        value.private = true;
      }
      emit(value.subject, value);
      if (doc.fields &&
          doc.fields.needs_signoff &&
          doc.contact
      ) {
        value.needs_signoff = true;
        var contact = doc.contact;
        while (contact) {
          if (contact._id && contact._id !== value.subject) {
            emit(contact._id, value);
          }
          contact = contact.parent;
        }
      }
      return;
    case 'task':
      return emit(doc.user, value);
    case 'target':
      return emit(doc.owner, value);
    case 'contact':
    case 'clinic':
    case 'district_hospital':
    case 'health_center':
    case 'person':
      return emit(doc._id, value);
  }
}

