  };
  _emit(doc.tasks || []);
  _emit(doc.scheduled_tasks || []);

  // incoming
  if (doc.type === 'data_record' && doc.sms_message) {
    _emitMsg(doc.sms_message.gateway_ref, doc.sms_message.uuid);
  }
}

